const booksLoaded = (payload) => ({type: 'BOOKS_LOADED', payload});
const booksRequested = () => ({type: 'BOOKS_REQUESTED'});
const booksError = (payload) => ({type: 'BOOKS_ERROR', payload});
const fetchBooks = (dispatch, ownProps) => ({}) => {
    const { getAll } = ownProps.bookstoreService;
    dispatch(booksRequested());
    getAll()
      .then((data) => dispatch(booksLoaded(data)))
      .catch((error) => dispatch(booksError(error)))
}

export {
  booksLoaded,
  booksRequested,
  booksError
};
